import './App.css';

function App() {

  return (
    <div className="App">
      {planets.map((planet, key) => {
        if (planet.isGasPlanet) return <Planet name={planet.name}  />;
      })}
      {planets.map((planet, key) => !planet.isGasPlanet && <Planet name={planet.name}  />
      )};
    </div>
  );
}

const Planet = (props) => {
  return (
    <div>
      <h1>{props.name}</h1>
    </div>
  );
}

export default App;
